// Youtube Actions
function viewOnYoutube(contentInfo) {
  let url = "https://www.youtube.com/watch?v=" + contentInfo.id.videoId;

  var win = window.open(url, "_blank");
  win.focus();
}
exports.viewOnYoutube = viewOnYoutube;
